//Dialog Box to select params for Graph generation
import * as React from "react";

// importing material UI components
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Button from "@mui/material/Button";
import { Input } from "@mui/material";

export default function SubHeader(props) {
    // const style = {
    //     background = '#2E3B55',
    // };
    const {nodes=200, types = [{label:"SQUARE GRID",value:"SQR"},{label:"BINARY BALANCED",value:"BIN"}], onGenerate=()=>{}, onChange=()=>{}} = props



return (
    <div>
        <table width='100%' border={1}>
            <tr>
                <td align="center" colSpan={2}>
                    Select nodes
                </td>
                <td align="center" colSpan={2}>
                    Select type
                </td>
                <td rowSpan={3} align='center' colSpan={2}>
                    <Button sx={{bgcolor:'primary', width:'100%'}}>Generate</Button>
                </td>
            </tr>
            <tr>
                <td rowSpan={2} align='center'>
                    <Input placeholder='#NODES' value={nodes} align='center' sx={{width:10}}></Input>
                </td>
                <td>
                    <Button>+</Button>
                </td>
                <td colSpan={2} rowSpan={2} align='center'>
                <select value={props.value} onChange={props.onChange}>
                    {types.map((option) => (
                         <option value={option.value}>{option.label}</option>
                     ))}
                 </select>
                </td>
            </tr>
            <tr>
                <td>
                    <Button>-</Button>
                </td>
            </tr>
        </table>

    </div>
